import React from "react";
import HomeCards from "./cards";
const HomePage = () => {
  return (
    <body className="container mt-3 ">
      <center>
        <div className="backgroundtype-card-grey pb-3">
          <h1>Welcome to Nick's React App</h1>
          <p className="mt-3">
            For your convinecne, I listed the links to the other portions of the
            site below.
          </p>
        </div>
        <HomeCard
          mainContent="Your currently on the homepage but if you navigate around using the
            color changing bar above, I'm sure you will have a blast learning
            more about me."
          header="Test"
        />
      </center>
    </body>
  );
};
export default HomePage;
